import React from 'react';
import { Image, Grid, Feed, Icon, Card, Header } from 'semantic-ui-react';

const _HeaderMovieCast = props => {

    return (
        <React.Fragment>
            <center>
                <Image onClick={() => props.movieDetials(props.movie.id)} src={props.movieImage} className="sizeOfNewSearchMovie" />
            </center>
        </React.Fragment>
    )
}

export default _HeaderMovieCast;
